import Contact from "../image/contact.svg";
import Checked from "../image/security.svg";


const Login = () =>{
    return(
        <>
            <div className="container">
                <div className='row'>

                    <div className="col-10 col-md-10 col-lg-8 col-sm-12 mx-auto">

                        <div className="LoginBox">

                        </div>


                    </div>


                </div>
            </div>
        </>
    )
}

export default Login;
